import React, { Component } from 'react';

export interface IVideo {
    url: {
        res: string,
        url: string,
    }[]
}

const DisplayVideos = (videos: IVideo) => {
    // Get highest resolution video
    const highestRes = videos.url.reduce((prev, curr) => {
        return parseInt(prev.res, 10) > parseInt(curr.res, 10) ? prev : curr;
    });

    const rows = videos.url.map((row, index) => {
        return (
            <li><a className="dropdown-item" href={row.url} target="_blank" download>{row.res}</a></li>
        )
    })
    return (
        <div className="btn-group mt-2">
            <button type="button" className="btn btn-success dropdown-toggle" data-bs-toggle="dropdown" aria-expanded="false">
                Choose Resolution
            </button>
            {/* <ul className="dropdown-menu">
